import React from 'react'

import Card from 'react-bootstrap/Card'

  const PlayerCard = (props) => {

        return (
          <Card style={{ width: '18rem'}}>
            <Card.Body>
                {props.players.map(p => <li key={p.id}>{p.name}</li>)}
                {props.players.map(p => <li key={p.id}>{p.player_type}</li>)}
                {props.players.map(p => <li key={p.id}>{p.cost}</li>)}
                {props.players.map(p => <li key={p.id}>{p.movement_allowance}</li>)}
                {props.players.map(p => <li key={p.id}>{p.strength}</li>)}
                {props.players.map(p => <li key={p.id}>{p.agility}</li>)}
                {props.players.map(p => <li key={p.id}>{p.armour_value}</li>)}
                {props.players.map(p => <li key={p.id}>{p.skills}</li>)}
            </Card.Body>
        </Card>
        )
    }


export default PlayerCard
